import classes from './Button.module.css';

const Button = props => {
  return (
    <div className={button}>
      <button
        disabled={props.disabled}
        type={props.type}
        value={props.value}
        className={classes.button}
      >
        {props.children}
      </button>
    </div>
  );
};

export default Button;
